import React from 'react';
import send from '../assets/li-send.svg';
import './Home.css';

const Home = () => {
  return (
    <div className="overlap-group2">
      <div className="flex-col">
        <div className="hero-headline">
          <h1 className="top-quality-produce">
            Top quality produce, from our farms to your table.
          </h1>
        </div>
        <div className="subscribe-formz">
          <div className="newsletter-form">
            <img className="lisend" src={send}></img>
            <div className="frame-4">
              <div className="email-entry">Enter your email address</div>
            </div>
          </div>
          <div className="subscribe-btn">
            <div className="subscribe">Subscribe</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
